import React from "react";

import mBkg from "../image/background.jpg";
import bBkg from "../image/underBackgrouns.jpeg";

const Home = () => {
  return (
    <div>
      <img alt="Main" src={mBkg} width="100%" height="500px" />
      <div className="text1">
        <p style={{ fontSize: "35px", lineHeight: "80px", fontWeight: "bold" }}>
          Under One Framework ‚Äè{" "}
        </p>
        <p style={{ fontSize: "35px", lineHeight: "10px", fontWeight: "bold" }}>
          Basic Data Services with Smooth Work!
        </p>
        <hr
          style={{
            borderTop: "4px solid #606061d3",
            width: "50%",
            marginTop: "50px"
          }}
        />
      </div>
      <img alt="Botton" src={bBkg} width="100%" height="200px" />
      <div style={{ backgroundColor: "gray" }}>
        <label>Contact Information: </label>
        <span>
          <img alt="email" src="../image/email.png" width="20px" />
          support@recoverly.com{" "}
        </span>
        <span>
          <img alt="phone" src="../image/phone.png" width="20px" />
          +96654321978{" "}
        </span>
        <span>
          <img alt="location" src="../image/location.png" width="20px" />
          saudi arabia , qassim{" "}
        </span>
      </div>
    </div>
  );
};

export default Home;
